  return (
    <div className='hero-container'>
      <video src={video} />
      <h1>Fraction Analytics </h1>
      <p>we offer you a smart security services</p>
      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
